import React from 'react'
import { FiEdit } from "react-icons/fi";
const Profile = () => {
    return (
        <div className="Profile">
            <div className="upper-profile">
                <img src="https://res.cloudinary.com/dfdzjhr8x/image/upload/v1625830250/avatar/m0ietv9mq5qddcumnywx.jpg" alt="" />
            </div>

            <div className="sidebar-profile">
                <img src="https://res.cloudinary.com/dfdzjhr8x/image/upload/v1625830250/avatar/m0ietv9mq5qddcumnywx.jpg" alt=""><FiEdit /></img>
            </div>
        </div>
    )
}

export default Profile
